{
    g40=ghyy*ee*ee;
    g25=g40*g40;
    g26=x23*x14;
    g27=x24*x13;
    g33=g25*x34;
    g29=g27*g25;
    g30=g26*g25;
    g37=2.0*(-g29-g30);
    g39=4.0*x34*s;
    msq2=(g33*x34*(g39+8.0*(-g27-g26))+g29*(32.0*g26-(16.0*g27))-(g39*g37)+s*s*(
     g37+g33*s)-(16.0*g30*g26))/(486.0*g27*g26);
};
